import zlib
import binascii

hex_data = ""

# 1. 헥스 -> 바이너리 변환
compressed_data = binascii.unhexlify(hex_data)

try:
    # 2. 일반 zlib 압축해제 시도
    decompressed = zlib.decompress(compressed_data)
except zlib.error:
    # 3. 실패 시 raw DEFLATE 압축해제 시도
    decompressed = zlib.decompress(compressed_data, -zlib.MAX_WBITS)

# 4. 결과 출력 (바이너리이므로 텍스트가 아닐 수도 있음)
print(decompressed.decode(errors='ignore'))
